import logotype from './logo.svg';
import './App.css';
//import AppHeader from './AppHeader';

const AppHeader = () =>{
  <header className="App-header">
      <img src={logotype} className="App-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
  </header>
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <img src={logotype} className="App-logo" alt="logo" />
      <p>
        Edit <code>src/App.js</code> and save to reload.
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
      </header>
    </div>
  );
}

export default App;
